import data from "./Data2";
import "./Content.css";
import { Link } from "react-router-dom";
function Item(props) {
  let one;
  if (props.notindex === -1) {
    if (data.properties.length % 4 === 0) {
      one = props.one;
      two = props.two;
      three = props.three;
      four = props.four;
    } else if (data.properties.length % 4 === 1) {
      one = props.one;
    } else if (data.properties.length % 4 === 2) {
      one = props.one;
      two = props.two;
    } else if (data.properties.length % 4 === 0) {
      one = props.one;
      two = props.two;
      three = props.three;
    }
  }
  if (props.sign === 1) {
    return (
      <div className="wrapper1">
        <div className="wrapper2">
          <div className="wrapper20">
            <Link
              to={{ pathname: "/bestItem", state: { one } }}
              style={{ textDecoration: "none", color: "black" }}
            >
              <div className="wrapper3">
                <div className="shirt">
                  <img
                    src={data.properties[props.one].picture}
                    className="itemimg"
                    alt="Loading..."
                  />
                </div>
                <p className="txt">{data.properties[props.one].name}</p>
                <p className="txt">{data.properties[props.one].price}</p>
              </div>
            </Link>
            <Link
              to={{ pathname: "/bestItem", state: props.two }}
              style={{ textDecoration: "none", color: "black" }}
            >
              <div className="wrapper3">
                <div className="shirt">
                  <img
                    src={data.properties[props.two].picture}
                    className="itemimg"
                    alt="Loading..."
                  />
                </div>
                <p className="txt">{data.properties[props.two].name}</p>
                <p className="txt">{data.properties[props.two].price}</p>
              </div>
            </Link>
          </div>
          <div className="wrapper20">
            <Link
              to={{ pathname: "/bestItem", state: props.three }}
              style={{ textDecoration: "none", color: "black" }}
            >
              <div className="wrapper3">
                <div className="shirt">
                  <img
                    src={data.properties[props.three].picture}
                    className="itemimg"
                    alt="Loading..."
                  />
                </div>
                <p className="txt">{data.properties[props.three].name}</p>
                <p className="txt">{data.properties[props.three].price}</p>
              </div>
            </Link>
            <Link
              to={{ pathname: "/bestItem", state: props.four }}
              style={{ textDecoration: "none", color: "black" }}
            >
              <div className="wrapper3">
                <div className="shirt">
                  <img
                    src={data.properties[props.four].picture}
                    className="itemimg"
                    alt="Loading..."
                  />
                </div>
                <p className="txt">{data.properties[props.four].name}</p>
                <p className="txt">{data.properties[props.four].price}</p>
              </div>
            </Link>
          </div>
        </div>
      </div>
    );
  } else if (data.properties.length % 4 === 1) {
    return (
      <div className="wrapper1">
        <div className="wrapper2">
          <div className="wrapper20">
            <Link
              to={{ pathname: "/bestItem", state: { one } }}
              style={{ textDecoration: "none", color: "black" }}
            >
              <div className="wrapper3">
                <div className="shirt">
                  <img
                    src={data.properties[props.one].picture}
                    className="itemimg"
                    alt="Loading..."
